//Components
import TopNav from "../Components/Layout/top-nav";
import Slider from "../Components/slider";
import ParcelTracker from '../Components/parcel-tracker';
import Services from '../Components/our-services';
//Home CSS
import "./Home.css"
function Home(){
    return(
        <div className='body'>
            <TopNav />
            <Slider/>
            <br/>
            <ParcelTracker/>
            <Services />
        </div>
    )
}

export default Home;
